"    Aspergillus bronchiolitis and bronchopneumonia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 534px; height: 180px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
